'use strict';
let OrdersList = require('./OrdersList.js');
let MessageType = require('./MessageType.js');
class GetOrdersMessage {
    ordersList;
    accountId;
    constructor() {
        this.ordersList = new OrdersList();
    }
    getOrders() {
        return this.ordersList.toArray();
    }
    getAccountId() {
        return this.accountId;
    }
    getType() {
        return MessageType.GetOrders;
    }
}
module.exports = GetOrdersMessage
